class Exerc1 extends React.Component {
  render() {
    return (<div>
      <ul>
        <li>Aprender React</li>
        <li>Aprender a sintaxe</li>
        <li>Realizar o projeto</li>
      </ul>
    </div>)
  }
}

export default Exerc1;
